import React from 'react'
import { Bar, Line, Pie } from 'react-chartjs-2'
const chartData = (props) => {
  return (
    <div>
      <h1>Chart Component</h1>
      <Bar 
        data={props.data.chartData}
        options={{
          maintainAspectRatio: false
        }}
      />
    </div>
  )
}

export default chartData
